#include <iostream>
#include <vector>
#include <queue>
using namespace std;

void fill(int i, int j, vector<vector<char> >& board) {
    if (board[i][j] == '-')
        return;
    board[i][j] = '-';
    queue<pair<int, int> > q;
    q.push(make_pair(i, j));
    while (!q.empty()) {
        pair<int, int> node = q.front();
        q.pop();
        i = node.first;
        j = node.second;
        if (i > 0 && board[i - 1][j] == 'O')
        {
            board[i - 1][j] = '-';
            q.push(make_pair(i - 1, j));
        }
        if (i < board.size() - 1 && board[i + 1][j] == 'O')
        {
            board[i + 1][j] = '-';
            q.push(make_pair(i + 1, j));
        }
        if (j > 0 && board[i][j - 1] == 'O')
        {
            board[i][j - 1] = '-';
            q.push(make_pair(i, j - 1));
        }
        if (j < board[0].size() - 1 && board[i][j + 1] == 'O')
        {
            board[i][j + 1] = '-';
            q.push(make_pair(i, j + 1));
        }
    }
}

void solve(vector<vector<char> >& board) {
    if (board.empty())
        return;
    if (board[0].empty())
        return;
    int m = board.size(), n = board[0].size();
    if (m == 1 || n == 1)
        return;
    for (int i = 0; i < m; i++) {
        if (board[i][0] == 'O') {
            fill(i, 0, board);
        }
        if (board[i][n - 1] == 'O') {
            fill(i, n - 1, board);
        }
    }
    for (int i = 1; i < n - 1; i++) {
        if (board[0][i] == 'O') {
            fill(0, i, board);
        }
        if (board[m - 1][i] == 'O') {
            fill(m - 1, i, board);
        }
    }
    for (int i = 0; i < m; i++) {
        for (int j = 0; j < n; j++) {
            if (board[i][j] == '-')
                board[i][j] = 'O';
            else if (board[i][j] == 'O')
                board[i][j] = 'X';
        }
    }
}
